def to_list(my_dictionary: dict) -> list[dict]:
    """
    Returns a list of the book data, based on the "my_dictionary" dictionary argument
    Note: my_dictionary is inputed as a dictionary with keys as the "category"

    >>> to_list(my_dictionary)
    [{'title': 'Spider-Man: Anti-Venom', 'author': 'Dan Slott', 'rating': 4.0, 'publisher': 'Marvel Entertainment', 'pages': 96, 'language': 'English', 
      'category': 'Superheroes'},          
     {'title': 'Watchmen (2019 Edition)', 'author': 'Alan Moore', 'rating': 4.2, 'publisher': 'DC Comics', 'pages': 448, 'language': 'English', 
      'category': 'Superheroes'}, 
    {'title': 'Spider-Verse: Volume 1', 'author': 'Dan Slott', 'rating': 4.4, 'publisher': 'Marvel Entertainment', 'pages': 624, 'language': 'English', 
    'category': 'Superheroes'}, 
    {'title': 'Young Justice Vol. 1', 'author': 'Art Baltazar', 'rating': 4.1, 'publisher': 'DC', 'pages': 164, 'language': 'English', 
    'category': 'Superheroes'},
    {'title': 'Immortal Hulk Vol. 1: Or Is He Both?', 'author': 'Al Ewing', 'rating': 4.4, 'publisher': 'Marvel Entertainment', 'pages': 128, 'language': 'English', 
    'category': 'Superheroes'}, 
    {'title': 'The Mysterious Affair at Styles', 'author': 'Agatha Christie', 'rating': 4.4, 'publisher': 'HarperCollins UK', 'pages': 208, 'language': 'English', 
    'category': 'Horror'}, 
    {'title': 'The Memoirs of Sherlock Holmes', 'author': 'Arthur Conan Doyle', 'rating': 4.2, 'publisher': 'Simon and Schuster', 'pages': 320, 'language': 'English', 
    'category': 'Classics'}, 
    {'title': 'The Mysterious Affair at Styles', 'author': 'Agatha Christie', 'rating': 4.4, 'publisher': 'HarperCollins UK', 'pages': 208, 'language': 'English', 
    'category': 'Classics'},
    ...
    ]
    
    >>> to_list(my_dictionary)
    [{'title': 'Deadpool Kills the Marvel Universe', 'author': 'Cullen Bunn', 'rating': 4.2, 'publisher': 'Marvel Entertainment', 'pages': 96, 'language': 'English', 
     'category': 'Comics'}, {'title': 'Young Justice Vol. 1', 'author': 'Art Baltazar', 'rating': 4.1, 'publisher': 'DC', 'pages': 164, 'language': 'English', 'category': 'Comics'}, {'title': 'Ultimate Spider-Man Vol. 11: Carnage', 'author': 'Brian Michael Bendis', 'rating': 4.1, 'publisher': 'Marvel Entertainment', 'pages': 144, 'language': 'English', 'category': 'Comics'},
     {'title': 'Immortal Hulk Vol. 1: Or Is He Both?', 'author': 'Al Ewing', 'rating': 4.4, 'publisher': 'Marvel Entertainment', 'pages': 128, 'language': 'English',
     'category': 'Comics'}, 
     {'title': 'Watchmen (2019 Edition)', 'author': 'Alan Moore', 'rating': 4.2, 'publisher': 'DC Comics', 'pages': 448, 'language': 'English', 
     'category': 'Comics'}, {'title': 'The Joker', 'author': 'Brian Azzarello', 'rating': 4.4, 'publisher': 'DC', 'pages': 130, 'language': 'English', 'category': 'Comics'}, 
     {'title': 'Venomized', 'author': 'Cullen Bunn', 'rating': 4.5, 'publisher': 'Marvel Entertainment', 'pages': 136, 'language': 'English', 
     'category': 'Comics'}, 
     {'title': 'Tall Tales and Wee Stories: The Best of Billy Connolly', 'author': 'Billy Connolly', 'rating': 5.0, 'publisher': 'Hachette UK', 'pages': 336, 'language': 'English', 'category': 'Humor'}, 
     {'title': 'Twas The Nightshift Before Christmas: Festive hospital diaries from the author of million-copy hit This is Going to Hurt', 'author': 'Adam Kay', 'rating': 4.7, 'publisher': 'Pan Macmillan', 'pages': 112, 'language': 'English', 'category': 'Humor'}
    ...
    ]
    """
    book_list = [] # Initalize empty dictionary with book information
    for key, books in my_dictionary.items():
        for book in books: # Each book in the list
            book.update({"category": key})# Append the category to the book
            book_list.append(book) # Each categories respective books
            # Category is a key characteristic that differentitates books with the same title    
    return book_list



#FUNCTION DEFINITION FOR FUNCTION 1
def sort_books_title(my_dictionary:dict)->list[dict]:
    """
    Returns a list containing a dictionary of books which will have thier titles sorted in alphabetical order 
    >>>sort_books_title(book_category_dictionary('google_books_dataset.csv'))
    [{'title': "'Salem's Lot", 'author': 'Stephen King', 'rating': 4.4, 'publisher': 'Hachette UK', 'pages': 300, 'language': 'English'}, {'title': 'A Feast for Crows (A Song of Ice and Fire. Book 4)', 'author': 'George R.R. Martin', 'rating': 4.5, 'publisher': 'HarperCollins UK', 'pages': 864, 'language': 'English'},
    ...
    ]
    """
    book_list=to_list(my_dictionary)
    length = len(book_list) 
    for i in range(length):
        for elem in range(length-i-1): 
            if book_list[elem].get("title") == book_list[elem + 1].get("title"): 
                if book_list[elem].get("publisher") > book_list[elem + 1].get("publisher"):
                    book_list[elem], book_list[elem + 1] = book_list[elem + 1], book_list[elem]
            
                elif book_list[elem].get("publisher") == book_list[elem + 1].get("publisher"): 
                    if book_list[elem].get("category") > book_list[elem + 1].get("category"):
                        book_list[elem], book_list[elem + 1] = book_list[elem + 1], book_list[elem]                  
            
            elif book_list[elem].get("title") > book_list[elem + 1].get("title"):
                book_list[elem], book_list[elem + 1] = book_list[elem + 1], book_list[elem]
    
    return book_list




